CREATE TABLE `reglement` (
  `id_reglement` int(11) NOT NULL AUTO_INCREMENT,
  `client` int(11) DEFAULT NULL,
  `num_fact` varchar(32) NOT NULL,
  `prix_ttc` decimal(14,3) DEFAULT NULL,
  `etat_reglement` varchar(20) DEFAULT NULL,
  `num_cheque` varchar(50) DEFAULT NULL,
  `date_cheque` varchar(50) DEFAULT NULL,
  `retenue_date` varchar(50) DEFAULT NULL,
  `TypeReglement` varchar(250) DEFAULT NULL,
  `montant` varchar(250) DEFAULT NULL,
  `dateReglement` varchar(250) DEFAULT NULL,
  `pieceRs` varchar(250) DEFAULT NULL,
  PRIMARY KEY (`id_reglement`),
  KEY `client` (`client`),
  KEY `idx_regl_num_fact` (`num_fact`),
  CONSTRAINT `fk_reglement_facture_v2` FOREIGN KEY (`num_fact`) REFERENCES `facture` (`num_fact`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `reglement_ibfk_2` FOREIGN KEY (`client`) REFERENCES `clients` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=809 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
